do
---Autoplace specification is used to determine which entities are placed when generating map. Currently it is used for enemy bases, tiles, resources and other entities (trees, fishes, etc.).
---
---Autoplace specification describe conditions for placing tiles, entities, and decoratives during surface generation. Autoplace specification defines probability of placement on any given tile and richness, which has different meaning depending on the thing being placed.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/AutoplaceSpecification.html)
---@class data.AutoplaceSpecification
---Name of the [AutoplaceControl](https://lua-api.factorio.com/latest/prototypes/AutoplaceControl.html) (row in the map generator GUI) that applies to this entity.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/AutoplaceSpecification.html#control)
---@field control? data.AutoplaceControlID
---Indicates whether the thing should be placed even if [MapGenSettings](https://lua-api.factorio.com/latest/concepts.html#MapGenSettings) do not provide frequency/size/richness for it. (either for the specific prototype or for the control named by AutoplaceSpecification.control).
---
---If true, normal frequency/size/richness (`value=1`) are used in that case. Otherwise it is treated as if 'none' were selected.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/AutoplaceSpecification.html#default_enabled)
---@field default_enabled? boolean
