---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html)
---@class data.CliffPlacementSettings
---Elevation at which the first row of cliffs is placed. Can not be set from the map generation GUI.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html#cliff_elevation_0)
---@field cliff_elevation_0? float
---Elevation difference between successive rows of cliffs. This is inversely proportional to 'frequency' in the map generation GUI. Specifically, when set from the GUI the value is `40 / frequency`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html#cliff_elevation_interval)
---@field cliff_elevation_interval? float
---Smoothing makes cliffs straighter on rough elevation but makes placement inaccurate. 0 is no smoothing, 1 is full smoothing. Values outside of 0-1 are possible for specific effects but not recommended.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html#cliff_smoothing)
---@field cliff_smoothing? float
---Name of the [AutoplaceControl](https://lua-api.factorio.com/latest/prototypes/AutoplaceControl.html).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html#control)
---@field control? data.AutoplaceControlID
---Name of the [CliffPrototype](https://lua-api.factorio.com/latest/prototypes/CliffPrototype.html).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html#name)
---@field name? data.EntityID
---Corresponds to 'continuity' in the GUI. This value is not used directly, but is used by the 'cliffiness' noise expression, which in combination with elevation and the two cliff elevation properties drives cliff placement (cliffs are placed when elevation crosses the elevation contours defined by `cliff_elevation_0` and `cliff_elevation_interval` when 'cliffiness' is greater than `0.5`). The default 'cliffiness' expression interprets this value such that larger values result in longer unbroken walls of cliffs, and smaller values (between `0` and `1`) result in larger gaps in cliff walls.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/CliffPlacementSettings.html#richness)
---@field richness? float
local data_CliffPlacementSettings={
}
end

