---Probability that a craft will yield one additional product. Also applies to bonus crafts caused by productivity.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#extra_count_fraction)
---@field extra_count_fraction? float
---Amount that should be deducted from any productivity induced bonus crafts.
---
---This value can safely be set larger than the maximum expected craft amount, any excess is ignored.
---
---This value is ignored when [allow\_productivity](https://lua-api.factorio.com/latest/prototypes/RecipePrototype.html#allow_productivity) is `false`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#ignored_by_productivity)
---@field ignored_by_productivity? uint16
---Amount that should not be included in the item production statistics, typically with a matching ingredient having the same amount set as [ignored\_by\_stats](https://lua-api.factorio.com/latest/types/ItemIngredientPrototype.html#ignored_by_stats).
---
---If `ignored_by_stats` is larger than the amount crafted (for instance due to probability) it will instead show as consumed.
---
---Products with `ignored_by_stats` defined will not be set as recipe through the circuit network when using the product's item-signal.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#ignored_by_stats)
---@field ignored_by_stats? uint16
---The name of an [ItemPrototype](https://lua-api.factorio.com/latest/prototypes/ItemPrototype.html).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#name)
---@field name data.ItemID
---Must be >= `0` and < `1`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#percent_spoiled)
---@field percent_spoiled? float
---Value between 0 and 1, `0` for 0% chance and `1` for 100% chance.
---
---The effect of probability is no product, or a linear distribution on \[min, max]. For a recipe with probability `p`, amount\_min `min`, and amount\_max `max`, the Expected Value of this product can be expressed as `p * (0.5 * (max + min))`. This is what will be shown in a recipe tooltip. The effect of `ignored_by_productivity` on the product is not shown.
---
---When `amount_min` and `amount_max` are not provided, `amount` applies as min and max. The Expected Value simplifies to `p * amount`, providing `0` product, or `amount` product, on recipe completion.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#probability)
---@field probability? double
---When hovering over a recipe in the crafting menu the recipe tooltip will be shown. An additional item tooltip will be shown for every product, as a separate tooltip, if the item tooltip has a description and/or properties to show and if `show_details_in_recipe_tooltip` is `true`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/ItemProductPrototype.html#show_details_in_recipe_tooltip)
