---Array of the [WorkingVisualisation::name](https://lua-api.factorio.com/latest/types/WorkingVisualisation.html#name) of working visualisations to enable when this pipe connection is present.
---
---If the owning fluidbox has [draw\_only\_when\_connected](https://lua-api.factorio.com/latest/types/FluidBox.html#draw_only_when_connected) set to `true`, then the working visualisation is only enabled if this pipe connection is *connected*.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/PipeConnectionDefinition.html#enable_working_visualisations)
---@field enable_working_visualisations? (string)[]
---Allowed direction of fluid flow at this connection. Pipeline entities (`pipe`, `pipe-to-ground`, and `storage-tank`) do not support this property.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/PipeConnectionDefinition.html#flow_direction)
---@field flow_direction? ("input-output")|("input")|("output")
---Expected to be unique inside of a single entity. Used to uniquely identify where a linked connection should connect to.
---
---Only loaded, and mandatory if `connection_type` is `"linked"`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/PipeConnectionDefinition.html#linked_connection_id)
