---@alias data.TechnologyTrigger (data.MineEntityTechnologyTrigger)|(data.CraftItemTechnologyTrigger)|(data.CraftFluidTechnologyTrigger)|(data.SendItemToOrbitTechnologyTrigger)|(data.CaptureSpawnerTechnologyTrigger)|(data.BuildEntityTechnologyTrigger)|(data.CreateSpacePlatformTechnologyTrigger)

do
---Either `count` or `count_formula` must be defined, never both.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/TechnologyUnit.html)
---@class data.TechnologyUnit
---How many units are needed. Must be `> 0`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/TechnologyUnit.html#count)
---@field count? uint64
---Formula that specifies how many units are needed per level of the technology.
---
---If the last characters of the prototype name are `-<number>`, the level is taken to be the number, e.g. `physical-projectile-damage-2` implies a number of `2`. This defaults to `1`. There does not need to be lower-level technologies for a technology to be detected as having a level, meaning a technology or sequence of upgrade technologies can begin at any number.
---
---For an infinite technology, the level begins at the given suffix (or `1` by default) and gains 1 level upon being researched, or if the `max_level` is reached, marked as completed. The initial level of a technology can not be greater than its `max_level`.
---
---`l` and `L` are provided as variables in the expression, they represent the current level of the technology.
---
---This formula can also be used at [runtime](https://lua-api.factorio.com/latest/classes/LuaHelpers.html#evaluate_expression).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/TechnologyUnit.html#count_formula)
---@field count_formula? data.MathExpression
---List of ingredients needed for one unit of research. The items must all be [ToolPrototypes](https://lua-api.factorio.com/latest/prototypes/ToolPrototype.html).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/TechnologyUnit.html#ingredients)
---@field ingredients (data.ResearchIngredient)[]
---How much time one unit takes to research. In a lab with a crafting speed of `1`, it corresponds to the number of seconds.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/TechnologyUnit.html#time)
---@field time double
local data_TechnologyUnit={
}
end

