---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#composition_mode)
---@field composition_mode data.VariableAmbientSoundCompositionMode
---Name of a layer which controls this layer, a layer cannot control itself.
---
---Only loaded, and mandatory if `composition_mode` is `"layer-controlled"`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#control_layer)
---@field control_layer? string
---Defines a mapping between controlling layer's samples and this (controlled) layer's samples. The number of items in the mapping must be the same as the number of samples in the controlling layer. Item in the mapping with index N defines which samples of this layer can play when the sample N is playing in the controlling layer.
---
---Only loaded, and mandatory if `composition_mode` is `"layer-controlled"`.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#control_layer_sample_mapping)
---@field control_layer_sample_mapping? ((uint8)[])[]
---If `true`, the last of [Sound::variations](https://lua-api.factorio.com/latest/types/Sound.html#variations) is played at the end of a sequence (if the sequence is long enough). The end sample counts towards the [VariableAmbientSoundLayerStateProperties::sequence\_length](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#sequence_length).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#has_end_sample)
---@field has_end_sample? boolean
---If `true`, the first of [Sound::variations](https://lua-api.factorio.com/latest/types/Sound.html#variations) is played at the start of a sequence. The start sample counts towards the [VariableAmbientSoundLayerStateProperties::sequence\_length](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#sequence_length)
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#has_start_sample)
---@field has_start_sample? boolean
---Name has to be unique across all layers.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#name)
---@field name string
---If greater than one, samples are composed in overlapping sub-layers, offset from each other.
---
---If greater than one, one of `sublayer_starting_offset` or `sublayer_offset` must be defined. Both cannot be defined together.
---
---Cannot be defined for layers with `"shuffled"` `composition_mode`.
---
---Cannot be zero.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#number_of_sublayers)
---@field number_of_sublayers? uint8
---Explicitly defines sample lengths. The whole sample is played when this is not specified.
---
---Cannot be defined together with `sublayer_offset`.
---
---The minimum cannot be zero.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#sample_length)
---@field sample_length? data.RandomRange
---Specifies offset between two sub-layers' samples.
---
---This implicitly dictates the sample lengths as two sub-layer offsets.
---
---Only loaded if `number_of_sublayers` is greater than one.
---
---Cannot be defined together with `sublayer_starting_offset`.
---
---The minimum of [RandomRange](https://lua-api.factorio.com/latest/types/RandomRange.html) variant cannot be zero.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#sublayer_offset)
---@field sublayer_offset? (data.RandomRange)|(data.ProbabilityTable)
---Specifies starting offset of the second sub-layer.
---
---Only loaded if `number_of_sublayers` is greater than one.
---
---Cannot be defined together with `sublayer_offset`.
---
---The minimum of [RandomRange](https://lua-api.factorio.com/latest/types/RandomRange.html) variant cannot be zero.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#sublayer_starting_offset)
---@field sublayer_starting_offset? (data.RandomRange)|(data.ProbabilityTable)
---Cannot be empty.
---
---Samples within a layer are the [Sound::variations](https://lua-api.factorio.com/latest/types/Sound.html#variations).
---
---Number of samples must be the same across all variants.
---
---Samples cannot have variable volume and all samples must have the same default volume.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#variants)
