---@class data.VariableAmbientSoundLayerStateProperties
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#enabled)
---@field enabled? boolean
---Pause before a layer finishes playing. The last repetition and consequently the layer being finished is not counted until the pause finishes.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#end_pause)
---@field end_pause? data.RandomRange
---The number of times a layer repeats itself until it's considered finished. If it's not defined, the layer never finishes on its own. What counts as repetition depends on the [VariableAmbientSoundCompositionMode](https://lua-api.factorio.com/latest/types/VariableAmbientSoundCompositionMode.html).
---
---Each sample played is counted as a repetition of `"randomized"` layer.
---
---Repetition of `"semi-randomized"` layer is counted when its sequence is finished.
---
---Repetition of `"shuffled"` layer is counted when all samples play once.
---
---Each sample played is counted as a repetition of `"layer-controlled"` layer.
---
---If `number_of_repetitions` of [VariableAmbientSoundLayer::control\_layer](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayer.html#control_layer) of `"layer-controlled"` layer is smaller than `number_of_repetitions` of the controlled layer, `number_of_repetitions` of the control layer is used for the purposes of `pause_between_repetitions` and `end_pause`.
---
---Cannot be zero.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#number_of_repetitions)
---@field number_of_repetitions? (data.RandomRange)|(data.ProbabilityTable)
---Pause between each repetition of a layer. The repetition is not counted until the pause finishes.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#pause_between_repetitions)
---@field pause_between_repetitions? data.RandomRange
---Pause between individual samples within a sequence.
---
---Cannot be defined for `"randomized"` layers without defining `sequence_length` as well. Alternatively, use `pause_between_repetitions` instead.
---
---Cannot be defined for layers with `sublayer_offset` defined.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#pause_between_samples)
---@field pause_between_samples? data.RandomRange
---Number of samples in a sequence.
---
---The minimum cannot be zero.
---
---Mandatory for layers with `"semi-randomized"` [VariableAmbientSoundCompositionMode](https://lua-api.factorio.com/latest/types/VariableAmbientSoundCompositionMode.html).
---
---Applicable for layers with `"randomized"` [VariableAmbientSoundCompositionMode](https://lua-api.factorio.com/latest/types/VariableAmbientSoundCompositionMode.html).
---
---Cannot be defined for layers with `"shuffled"` [VariableAmbientSoundCompositionMode](https://lua-api.factorio.com/latest/types/VariableAmbientSoundCompositionMode.html).
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#sequence_length)
---@field sequence_length? data.RandomRange
---A sample replaced by silence still counts as played for the purposes of sequence count, repetition count, pauses, etc.
---
---Must be in the `[0.0, 1.0]` interval.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#silence_instead_of_sample_probability)
---@field silence_instead_of_sample_probability? float
---Pause before a layer starts playing.
---
---[View Documentation](https://lua-api.factorio.com/latest/types/VariableAmbientSoundLayerStateProperties.html#start_pause)
---@field start_pause? data.RandomRange
